    class AuthWrapped extends React.Component {
        constructor(props) {
            super(props);
        }

        componentWillMount() {
            console.log(props);
            console.log(this.props.match.params);
        }

        render() {
            return (
                <AuthComponent history={this.props.history} />
            );
        }
    }
    return AuthWrapped;
}
